import axios from 'axios';
import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';

function ProfileProgress(props) {
    const [name,setName] = useState('');
    const navigate = useNavigate();
    const [all,setAll] = useState(0);
    const [today,setToday]= useState(0);
    const [graphic,setGrapic] = useState([]);
    const [primary,setPrimary] = useState(0)
    const [devices,setDeivice] = useState([]);
    const [b,setB] = useState(false)
    useEffect(()=>{
        OnReload();
    },[])



    const OnReload = async ()=>{
        try{
            const res = await axios.get("http://localhost/toDoList_backend/",{
                'params':{
                    'profileReload':true
                },
                withCredentials:true
            });
            const data = res.data
            if(data['status'] && data['status']===200){
                if(!data['profile']){
                    navigate('/');
                    
                }
                else{
                    setName(data['profile'])
                    setAll(data['allCompletedTasks'])
                    setToday(data['todayCompletedTasks'])
                    setGrapic(data['graphic']);
                    if(data['primary']){
                        handleSession(data['primary']);
                        setPrimary(1);
                        handleActive();

                    }
                  

                }
            }

           

        }catch(error){
            console.error(error)
        }
    }

    function handleActive(){
        const ps = document.querySelectorAll('.userLog_h')
        ps.forEach((element)=>{
            element.classList.remove('active_p');
            if(sessionStorage.getItem('printD')){
                element.getAttribute('data-b')
                if(element.getAttribute('data-b')===sessionStorage.getItem('printD')){
                    element.classList.add('active_p')
                }
            }
          
        })
    }

    function handleSession(data){
        if(sessionStorage.getItem('printD')){
           const s = sessionStorage.getItem('printD') 
           if(s==='true'){
            console.error('blocked')
                setDeivice(data['blocked'])
           }
           else{
                console.error('not blocked')
                setDeivice(data['notBlocked'])
           }
           console.error(data)
        }
        else{
            sessionStorage.setItem('printD',false);
        }

        setB(sessionStorage.getItem('printD'))
        handleActive()
    }

    const hadleLogout = async()=>{
        await axios.delete('http://localhost/toDoList_backend/',{
            'data':{
                logout:true
            },
            withCredentials:true
        });
        navigate('/');
        
    }


    const handleUserLogs = (e)=>{
        console.error(e.target.getAttribute('data-b'))
        sessionStorage.setItem('printD',e.target.getAttribute('data-b'))
        OnReload()
    }


    const handleBlockUnblock = async(e)=>{
        const id = e.target.getAttribute('data-id')
        let block=  e.target.getAttribute('data-block')
        if(block==='true'){
            block = true;
        }
        else{
            block = false
        }
       await axios.put('http://localhost/toDoList_backend/',{
            id,
            block,
            'blockDevice':true
        },{withCredentials:true})
        
        OnReload();
    }

    return (
        <div className='container-fluid pb-5'>
            <div className='profile-header container d-flex justify-content-start align-items-center flex-wrap gap-5 pb-5'>
                <h5>{name}</h5>
                <button onClick={hadleLogout}>Logout</button>
                
            </div>
            <div className='container d-flex justify-content-start align-items-start flex-wrap gap-5'>
                <div className='doneTask-box d-flex justify-content-start align-items-start gap-3 flex-row flex-md-column pe-0 pe-md-5'> 
                    <div className='doneTasks d-flex justify-content-center gap-2 align-items-center flex-column'>
                        <h4>{today}</h4>
                        <p>Today's Completed tasks</p>
                    </div>
                    <div className='doneTasks d-flex justify-content-center gap-2 align-items-center flex-column'>
                        <h4>{all}</h4>
                        <p>All time Completed tasks</p>
                    </div>
                </div>

                

                <div className='d-flex justify-content-start align-items-start gap-3 flex-column graphic-area'>
                    <h4>Completed tasks of last 7 days</h4>
                        <div className='graphic_box d-flex justify-content-start align-items-end gap-3 py-5'>
                            {Object.entries(graphic).map(([date,count])=>(
                                <div key={date} className='d-flex justify-content-center align-items-center gap-3 flex-column graphic_candle_box'>
                                    <p>{count}</p>
                                    <div style={{height:`${count*20}px`, maxHeight:'200px'}} className='graphic_candle'></div>
                                    <span>{date}</span>
                                </div>
                            ))
                            
                            }
                        </div>
                </div>

                <div className={primary? 'p-3 logDevices-area  d-flex justify-content-start gap-2 align-items-start flex-wrap': 
                    'd-none'} >
                    <h3>Devices that logged into your account</h3>
                    <div className='w-100 d-flex justify-content-center gap-4 align-items-center py-3'>
                        <p data-b={false} className='userLog_h active_p' onClick={handleUserLogs}>Not Blocked</p>
                        <p data-b={true} className='userLog_h' onClick={handleUserLogs}>Blocked</p>
                    </div>
                    <div className='d-flex logDevices-box justify-content-start gap-2 align-items-start flex-wrap overflow-y-auto'>
                        {devices.map((element)=>(
                            <div className='logDevice p-4' key={element.id}>
                                <h5>{element.os}</h5>
                                <span>Browser: {element.browser}</span>
                                <p>screen size : {element.screen_size}</p>
                                {b==='true' ? <button data-id={element.id} onClick={handleBlockUnblock} data-block={false} className='unblock_btn'>Unblock</button>:
                                <button data-id={element.id} onClick={handleBlockUnblock} data-block={true}>Block</button>}
                            </div>
                        ))}
                    </div>
                </div>
            </div>
        </div>
    );
}

export default ProfileProgress;
